import { View, Text, StyleSheet } from "react-native";
import React from "react";

const CustomButton = () => {
    return (
        <View style={styles.container}>
            <Text style={styles.text}>Button</Text>
        </View>
    );
};

const styles = StyleSheet.create({
    container: {},
    text: {},
});

export default CustomButton;
